import sys

with open('rosalind_dna.txt','r') as myfile:
    s = myfile.read() #converts file contents to a string

print(s)

#s = ''
dna = s.strip()
print(dna)

dnacount = []

for i in 'ACGT':
    num = dna.count(i)
    dnacount.append(num)

print(type(dnacount))

dnastring = ' '.join(map(str, dnacount))
print(dnastring)
